            'description' => '{"en":"<p>Cannabis Law refers to the legal framework that governs the cultivation, possession, distribution, sale, and use of cannabis, commonly known as marijuana or weed. Over the years, attitudes and regulations surrounding cannabis have evolved significantly, leading to a complex and dynamic legal landscape in various jurisdictions worldwide. The content of cannabis law typically covers the following key aspects:<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li>\\r\\n\\t<p>Cannabis Legalization: Some countries and states have chosen to legalize cannabis for medicinal and\\/or recreational purposes. Legalization often involves setting up a regulatory system to control and oversee the production, distribution, and sale of cannabis products. These laws define who can participate in the cannabis industry, licensing requirements, and product safety standards.<\\/p>\\r\\n\\t<\\/li>\\r\\n\\t<li>\\r\\n\\t<p>Medical Cannabis: Many jurisdictions have recognized the therapeutic potential of cannabis and have established legal frameworks for medical cannabis use. Medical cannabis laws typically require patients to obtain a medical recommendation or prescription from a licensed healthcare provider to access cannabis products for specific medical conditions.<\\/p>\\r\\n\\t<\\/li>\\r\\n\\t<li>\\r\\n\\t<p>Recreational Use: In regions where recreational cannabis is legal, individuals over a certain age can purchase and possess cannabis products for personal use. Legalization for recreational use may come with restrictions on the quantity individuals can possess, where they can consume it, and regulations to ensure public safety.<\\/p>\\r\\n\\t<\\/li>\\r\\n\\t<li>\\r\\n\\t<p>Licensing and Regulation: Cannabis law often dictates the licensing process for businesses involved in cannabis cultivation, processing, distribution, and retail. Regulations cover issues such as security requirements, quality control, advertising restrictions, taxation, and zoning laws for cannabis-related businesses.<\\/p>\\r\\n\\t<\\/li>\\r\\n\\t<li>\\r\\n\\t<p>Public Health and Safety: Cannabis laws address public health and safety concerns related to cannabis use. They may set limits on THC potency, impose restrictions on advertising, require product testing and labeling, and outline penalties for impaired driving.<\\/p>\\r\\n\\t<\\/li>\\r\\n\\t<li>\\r\\n\\t<p>Industrial Hemp: Many countries have differentiated between cannabis with high THC content (marijuana) and cannabis with low THC content (industrial hemp). Laws related to industrial hemp govern its cultivation, processing, and use for various industrial purposes, such as fiber, textiles, and CBD production.<\\/p>\\r\\n\\t<\\/li>\\r\\n\\t<li>\\r\\n\\t<p>Federal vs. State\\/Provincial Laws: In some countries, cannabis laws can vary significantly between federal and regional levels of government. While federal law may classify cannabis as a controlled substance, individual states or provinces may choose to implement their own regulations, including legalization for medical or recreational use.<\\/p>\\r\\n\\t<\\/li>\\r\\n\\t<li>\\r\\n\\t<p>International Cannabis Laws: The global legality of cannabis varies from country to country, and international treaties, such as the Single Convention on Narcotic Drugs, influence how countries approach cannabis control. Some countries may face challenges due to conflicting international and domestic cannabis laws.<\\/p>\\r\\n\\t<\\/li>\\r\\n\\t<li>\\r\\n\\t<p>Decriminalization: In some jurisdictions, cannabis use may be decriminalized, meaning that possession of small amounts is treated as a civil offense rather than a criminal one. Decriminalization aims to reduce the burden on the criminal justice system while not fully legalizing cannabis.<\\/p>\\r\\n\\t<\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>Cannabis law is continually evolving as attitudes toward cannabis change, scientific research progresses, and societies grapple with issues of public health, criminal justice, and economic considerations. It&#39;s important for individuals and businesses operating within the cannabis industry or considering cannabis use to stay informed about the specific laws and regulations in their region to ensure compliance and avoid legal repercussions.<\\/p>","hi":"\\u092d\\u094c\\u0924\\u093f\\u0915 \\u0935\\u093f\\u091c\\u094d\\u091e\\u093e\\u0928 \\u092a\\u0926\\u093e\\u0930\\u094d\\u0925, \\u090a\\u0930\\u094d\\u091c\\u093e, \\u0917\\u0924\\u093f, \\u0914\\u0930 \\u092a\\u094d\\u0930\\u0915\\u0943\\u0924\\u093f \\u0915\\u0940 \\u092e\\u094c\\u0932\\u093f\\u0915 \\u0936\\u0915\\u094d\\u0924\\u093f\\u092f\\u094b\\u0902 \\u0915\\u093e \\u0905\\u0927\\u094d\\u092f\\u092f\\u0928 \\u0939\\u0948\\u0964 \\u0907\\u0938\\u092e\\u0947\\u0902 \\u092a\\u094d\\u0930\\u093e\\u091a\\u0940\\u0928 \\u092f\\u093e\\u0902\\u0924\\u094d\\u0930\\u093f\\u0915\\u0940, \\u0935\\u093f\\u0926\\u094d\\u092f\\u0941\\u0924\\u091a\\u0941\\u0902\\u092c\\u0915\\u0924\\u094d\\u0935, \\u090a\\u0937\\u094d\\u092e\\u093e \\u0935\\u093f\\u091c\\u094d\\u091e\\u093e\\u0928, \\u092a\\u094d\\u0930\\u0915\\u093e\\u0936\\u093f\\u0915\\u0940, \\u0914\\u0930 \\u0915\\u094d\\u0935\\u093e\\u0902\\u091f\\u092e \\u0935\\u093f\\u091c\\u094d\\u091e\\u093e\\u0928 \\u091c\\u0948\\u0938\\u0940 \\u0935\\u093f\\u092d\\u093f\\u0928\\u094d\\u0928 \\u0936\\u093e\\u0916\\u093e\\u090f\\u0902 \\u0936\\u093e\\u092e\\u093f\\u0932 \\u0939\\u0948\\u0902\\u0964 \\u092d\\u094c\\u0924\\u093f\\u0915 \\u0935\\u093f\\u091c\\u094d\\u091e\\u093e\\u0928 \\u092c\\u094d\\u0930\\u0939\\u094d\\u092e\\u093e\\u0902\\u0921 \\u0915\\u0947 \\u092e\\u094c\\u0932\\u093f\\u0915 \\u0938\\u093f\\u0926\\u094d\\u0927\\u093e\\u0902\\u0924\\u094b\\u0902 \\u0915\\u094b \\u0938\\u092e\\u091d\\u0928\\u0947 \\u0915\\u093e \\u092a\\u094d\\u0930\\u092f\\u093e\\u0938 \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948 \\u0914\\u0930 \\u0935\\u0938\\u094d\\u0924\\u0941\\u0913\\u0902 \\u0914\\u0930 \\u092a\\u094d\\u0930\\u0915\\u094d\\u0930\\u093f\\u092f\\u093e\\u0913\\u0902 \\u0915\\u0947 \\u0935\\u094d\\u092f\\u0935\\u0939\\u093e\\u0930 \\u0915\\u094b \\u0935\\u093f\\u092d\\u093f\\u0928\\u094d\\u0928 \\u092a\\u0948\\u092e\\u093e\\u0928\\u094b\\u0902 \\u092a\\u0930 \\u0935\\u0930\\u094d\\u0923\\u0928 \\u0914\\u0930 \\u092a\\u0942\\u0930\\u094d\\u0935\\u093e\\u0928\\u0941\\u092e\\u093e\\u0928 \\u0915\\u0930\\u0928\\u0947 \\u0915\\u093e \\u092a\\u094d\\u0930\\u092f\\u093e\\u0938 \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948\\u0964 \\u092f\\u0939 \\u092a\\u094d\\u0930\\u094c\\u0926\\u094d\\u092f\\u094b\\u0917\\u093f\\u0915\\u0940, \\u0907\\u0902\\u091c\\u0940\\u0928\\u093f\\u092f\\u0930\\u093f\\u0902\\u0917, \\u0914\\u0930 \\u092a\\u094d\\u0930\\u093e\\u0915\\u0943\\u0924\\u093f\\u0915 \\u0926\\u0941\\u0928\\u093f\\u092f\\u093e \\u0915\\u0947 \\u0928\\u093f\\u0930\\u094d\\u0927\\u093e\\u0930\\u0923 \\u092e\\u0947\\u0902 \\u092e\\u0939\\u0924\\u094d\\u0935\\u092a\\u0942\\u0930\\u094d\\u0923 \\u0939\\u0948\\u0964\\r\\n<ol>\\r\\n\\t<li>\\r\\n\\t\\t<p>\\u0915\\u0948\\u0928\\u0947\\u092c\\u093f\\u0938 \\u0935\\u093f\\u0927\\u093e\\u0928: \\u0915\\u0941\\u091b \\u0926\\u0947\\u0936\\u094b\\u0902 \\u0914\\u0930 \\u0930\\u093e\\u091c\\u094d\\u092f\\u094b\\u0902 \\u0928\\u0947 \\u0915\\u0948\\u0928\\u0947\\u092c\\u093f\\u0938 \\u0915\\u094b \\u091a\\u093f\\u0915\\u093f\\u0924\\u094d\\u0938\\u093e \\u0914\\u0930\\/\\u092f\\u093e \\u092e\\u0928\\u094b\\u0930\\u0902\\u091c\\u0928\\u093f\\u0915 \\u0909\\u0926\\u094d\\u0926\\u0947\\u0936\\u094d\\u092f\\u094b\\u0902 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0935\\u0948\\u0927 \\u0915\\u0930\\u0928\\u0947 \\u0915\\u093e \\u091a\\u092f\\u0928 \\u0915\\u093f\\u092f\\u093e \\u0939\\u0948\\u0964 \\u0935\\u0948\\u0927\\u0940\\u0915\\u0930\\u0923 \\u0906\\u092e\\u0924\\u094c\\u0930 \\u092a\\u0930 \\u0915\\u0948\\u0928\\u0947\\u092c\\u093f\\u0938 \\u0909\\u0924\\u094d\\u092a\\u093e\\u0926\\u094b\\u0902 \\u0915\\u0947 \\u0909\\u0924\\u094d\\u092a\\u093e\\u0926\\u0928, \\u0935\\u093f\\u0924\\u0930\\u0923, \\u0914\\u0930 \\u092c\\u093f\\u0915\\u094d\\u0930\\u0940 \\u0915\\u094b \\u0928\\u093f\\u092f\\u0902\\u0924\\u094d\\u0930\\u093f\\u0924 \\u0914\\u0930 \\u092a\\u0930\\u094d\\u092f\\u0935\\u0947\\u0915\\u094d\\u0937\\u093f\\u0924 \\u0915\\u0930\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u090f\\u0915 \\u0935\\u093f\\u0928\\u093f\\u092f\\u093e\\u092e\\u0915 \\u0924\\u0902\\u0924\\u094d\\u0930 \\u0915\\u0940 \\u0938\\u094d\\u0925\\u093e\\u092a\\u0928\\u093e \\u0915\\u0930\\u0928\\u0947 \\u0915\\u0940 \\u092a\\u094d\\u0930\\u0915\\u094d\\u0930\\u093f\\u092f\\u093e \\u0915\\u094b \\u0936\\u093e\\u092e\\u093f\\u0932 \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948\\u0964 \\u092f\\u0947 \\u0915\\u093e\\u0928\\u0942\\u0928\\u0947\\u0902 \\u092f\\u0939 \\u0928\\u093f\\u0930\\u094d\\u0927\\u093e\\u0930\\u093f\\u0924 \\u0915\\u0930\\u0924\\u0940 \\u0939\\u0948\\u0902 \\u0915\\u093f \\u0915\\u0948\\u0938\\u0947 \\u0915\\u0948\\u0928\\u0947\\u092c\\u093f\\u0938 \\u0909\\u0926\\u094d\\u092f\\u094b\\u0917 \\u092e\\u0947\\u0902 \\u0936\\u093e\\u092e\\u093f\\u0932 \\u0939\\u094b \\u0938\\u0915\\u0924\\u0947 \\u0939\\u0948\\u0902, \\u0932\\u093e\\u0907\\u0938\\u0947\\u0902\\u0938 \\u092a\\u094d\\u0930\\u093e\\u0930\\u0902\\u092d \\u0915\\u0930\\u0928\\u0947 \\u0915\\u0940 \\u0906\\u0935\\u0936\\u094d\\u092f\\u0915\\u0924\\u093e\\u090f\\u0901, \\u0914\\u0930 \\u0909\\u0924\\u094d\\u092a\\u093e\\u0926 \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e \\u092e\\u093e\\u0928\\u0915\\u094b\\u0902 \\u0915\\u094b\\u0964<\\/p>\\r\\n\\t<\\/li>\\r\\n\\t<li>\\r\\n\\t\\t<p>\\u091a\\u093f\\u0915\\u093f\\u0924\\u094d\\u0938\\u093e \\u0915\\u0948\\u0928\\u0947\\u092c\\u093f\\u0938: \\u0915\\u0908 \\u092a\\u0930\\u093f\\u092f\\u094b\\u091c\\u0928\\u093e\\u0913\\u0902 \\u0928\\u0947 \\u0915\\u0948\\u0928\\u0947\\u092c\\u093f\\u0938 \\u0915\\u0947 \\u0914\\u0937\\u0927\\u0940\\u092f \\u0909\\u092a\\u092f\\u094b\\u0917 \\u0915\\u0940 \\u0914\\u0937\\u0927\\u093f\\u0915 \\u0917\\u0941\\u0923\\u094b\\u0902 \\u0915\\u094b \\u092e\\u093e\\u0928\\u094d\\u092f\\u0924\\u093e \\u0926\\u0940 \\u0939\\u0948 \\u0914\\u0930 \\u091a\\u093f\\u0915\\u093f\\u0924\\u094d\\u0938\\u093e \\u0915\\u0948\\u0928\\u0947\\u092c\\u093f\\u0938 \\u0909\\u092a\\u092f\\u094b\\u0917 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0935\\u0948\\u0927\\u093f\\u0915 \\u0928\\u093f\\u0930\\u094d\\u0926\\u0947\\u0936\\u093f\\u0915\\u093e \\u0938\\u094d\\u0925\\u093e\\u092a\\u093f\\u0924 \\u0915\\u0940 \\u0939\\u0948\\u0964 \\u091a\\u093f\\u0915\\u093f\\u0924\\u094d\\u0938\\u093e \\u0915\\u0948\\u0928\\u0947\\u092c\\u093f\\u0938 \\u0915\\u093e\\u0928\\u0942\\u0928\\u094b\\u0902 \\u0915\\u0940 \\u0906\\u092e\\u0924\\u094c\\u0930 \\u092a\\u0930 \\u0906\\u0935\\u0936\\u094d\\u092f\\u0915\\u0924\\u093e \\u0939\\u0948 \\u0915\\u093f \\u0930\\u094b\\u0917\\u093f\\u092f\\u094b\\u0902 \\u0915\\u094b \\u0915\\u093f\\u0938\\u0940 \\u092a\\u094d\\u0930\\u093e\\u0927\\u093f\\u0915\\u0943\\u0924 \\u0938\\u094d\\u0935\\u093e\\u0938\\u094d\\u0925\\u094d\\u092f \\u0938\\u0947\\u0935\\u093e \\u092a\\u094d\\u0930\\u0926\\u093e\\u0924\\u093e \\u0938\\u0947 \\u091a\\u093f\\u0915\\u093f\\u0924\\u094d\\u0938\\u093e \\u0938\\u093f\\u092b\\u093e\\u0930\\u093f\\u0936 \\u092f\\u093e \\u0926\\u0935\\u093e \\u092a\\u094d\\u0930\\u093e\\u092a\\u094d\\u0924 \\u0915\\u0930\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u090f\\u0915 \\u091a\\u093f\\u0915\\u093f\\u0924\\u094d\\u0938\\u093e \\u0938\\u093f\\u092b\\u093e\\u0930\\u093f\\u0936 \\u092f\\u093e \\u0926\\u0935\\u093e \\u0915\\u0940 \\u091c\\u0930\\u0941\\u0930\\u0924 \\u0939\\u094b\\u0964<\\/p>\\r\\n\\t<\\/li>\\r\\n\\t<li>\\r\\n\\t\\t<p>\\u092e\\u0928\\u094b\\u0930\\u0902\\u091c\\u0928\\u093f\\u0915 \\u0909\\u092a\\u092f\\u094b\\u0917: \\u0909\\u0928 \\u0915\\u094d\\u0937\\u0947\\u0924\\u094d\\u0930\\u094b\\u0902 \\u092e\\u0947\\u0902 \\u091c\\u0939\\u093e\\u0902 \\u092e\\u0928\\u094b\\u0930\\u0902\\u091c\\u0928\\u093f\\u0915 \\u0915\\u0948\\u0928\\u0947\\u09