                'description' => '{"en":"<p>Database Management Systems are computer systems used to create, modify, and manage databases. These systems provide the ability to store, modify, and manage data so that users and other software can access it.<\\/p>","hi":"<p>\\u0921\\u0947\\u091f\\u093e\\u092c\\u0947\\u0938 \\u092a\\u094d\\u0930\\u092c\\u0902\\u0927\\u0928 \\u0938\\u093f\\u0938\\u094d\\u091f\\u092e \\u090f\\u0915 \\u0915\\u0902\\u092a\\u094d\\u092f\\u0942\\u091f\\u0930\\u0940\\u092f \\u092a\\u094d\\u0930\\u0923\\u093e\\u0932\\u0940 \\u0939\\u094b\\u0924\\u0940 \\u0939\\u0948 \\u091c\\u094b \\u0921\\u0947\\u091f\\u093e\\u092c\\u0947\\u0938 \\u0915\\u094b \\u092c\\u0928\\u093e\\u0928\\u0947, \\u0938\\u0902\\u0936\\u094b\\u0927\\u093f\\u0924 \\u0915\\u0930\\u0928\\u0947, \\u0914\\u0930 \\u092a\\u094d\\u0930\\u092c\\u0902\\u0927\\u093f\\u0924 \\u0915\\u0930\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0909\\u092a\\u092f\\u094b\\u0917 \\u0915\\u0940 \\u091c\\u093e\\u0924\\u0940 \\u0939\\u0948\\u0964 \\u092f\\u0939 \\u0938\\u093f\\u0938\\u094d\\u091f\\u092e \\u0921\\u0947\\u091f\\u093e \\u0915\\u094b \\u0938\\u0902\\u0917\\u094d\\u0930\\u0939\\u093f\\u0924 \\u0915\\u0930\\u0928\\u0947, \\u0938\\u0902\\u0936\\u094b\\u0927\\u093f\\u0924 \\u0915\\u0930\\u0928\\u0947, \\u0914\\u0930 \\u092a\\u094d\\u0930\\u092c\\u0902\\u0927\\u093f\\u0924 \\u0915\\u0930\\u0928\\u0947 \\u0915\\u0940 \\u0915\\u094d\\u0937\\u092e\\u0924\\u093e \\u092a\\u094d\\u0930\\u0926\\u093e\\u0928 \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948 \\u0924\\u093e\\u0915\\u093f \\u0909\\u092a\\u092f\\u094b\\u0917\\u0915\\u0930\\u094d\\u0924\\u093e \\u0914\\u0930 \\u0905\\u0928\\u094d\\u092f \\u0938\\u0949\\u092b\\u093c\\u094d\\u091f\\u0935\\u0947\\u092f\\u0930 \\u0909\\u0938\\u0947 \\u092a\\u0939\\u0941\\u0902\\u091a \\u0938\\u0915\\u0947\\u0902\\u0964<\\/p>","ar":"<p>\\u0623\\u0646\\u0638\\u0645\\u0629 \\u0625\\u062f\\u0627\\u0631\\u0629 \\u0642\\u0648\\u0627\\u0639\\u062f \\u0627\\u0644\\u0628