                'name' => '{"en":"Ethical Hacking","hi":"\\u0928\\u0948\\u0924\\u093f\\u0915 \\u0939\\u0948\\u0915\\u093f\\u0902\\u0917","ar":"\\u0627\\u0644\\u0642\\u0631\\u0635\\u0646\\u0629 \\u0627\\u0644\\u0623\\u062e\\u0644\\u0627\\u0642\\u064a\\u0629"}',
                'description' => '{"en":"<p>Ethical Hacking is a process in which hackers seek vulnerabilities in an organization\'s security so that the organization can address those specific weaknesses that could compromise their networks, systems, and software. It is a crucial tool in identifying and fixing security challenges for organizations.<\\/p>","hi":"<p>\\u0928\\u0948\\u0924\\u093f\\u0915 \\u0939\\u0948\\u0915\\u093f\\u0902\\u0917 \\u090f\\u0915 \\u092a\\u094d\\u0930\\u0915\\u094d\\u0930\\u093f\\u092f\\u093e \\u0939\\u0948 \\u091c\\u093f\\u0938\\u092e\\u0947\\u0902 \\u0939\\u0948\\u0915\\u0930\\u094d\\u0938 \\u090f\\u0915 \\u0938\\u0902\\u0917\\u0920\\u0928 \\u0915\\u0940 \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e \\u092e\\u0947\\u0902 \\u0915\\u092e\\u093f\\u092f\\u093e\\u0902 \\u0916\\u094b\\u091c\\u0924\\u0947 \\u0939\\u0948\\u0902, \\u0924\\u093e\\u0915\\u093f \\u0938\\u0902\\u0917\\u0920\\u0928 \\u0909\\u0928 \\u0935\\u093f\\u0936\\u0947\\u0937 \\u0909\\u0924\\u094d\\u0925\\u093e\\u0928\\u094b\\u0902 \\u0915\\u094b \\u0938\\u0941\\u0927\\u093e\\u0930 \\u0938\\u0915\\u0947 \\u091c\\u094b \\u0909\\u0928\\u0915\\u0947 \\u0928\\u0947\\u091f\\u0935\\u0930\\u094d\\u0915, \\u0938\\u093f\\u0938\\u094d\\u091f\\u092e, \\u0914\\u0930 \\u0938\\u0949\\u092b\\u093c\\u094d\\u091f\\u0935\\u0947\\u092f\\u0930 \\u0915\\u094b \\u0915\\u092e\\u091c\\u094b\\u0930 \\u092c\\u0928\\u093e \\u0938\\u0915\\u0924\\u0947 \\u0939\\u0948\\u0902\\u0964 \\u092f\\u0939 \\u090f\\u0915 \\u0905\\u0939\\u092e \\u0909\\u092a\\u0915\\u0930\\u0923 \\u0939\\u0948 \\u0938\\u0902\\u0917\\u0920\\u0928\\u094b\\u0902 \\u0915\\u0947 \\u0938\\u0941\\u0930\\u0915\\u094d\\u0937\\u093e \\u091a\\u0941\\u0928\\u094c\\u0924\\u093f\\u092f\\u094b\\u0902 \\u0915\\u094b \\u092a\\u0939\\u091a\\u093e\\u0928\\u0928\\u0947 \\u0914\\u0930 \\u0909\\u0928\\u094d\\u0939\\u0947\\u0902 \\u0920\\u0940\\u0915 \\u0915\\u0930\\u0928\\u0947 \\u092e\\u0947\\u0902\\u0964<\\/p>","ar":"<p>\\u0627\\u0644\\u0642\\u0631\\